INSERT INTO `book` (`ID`, `NAME`,`PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(1, 'Effective Java', 'Addison-Wesley', '2008-05-28', '<p>	Are you looking for a deeper understanding of the Java&trade; programming language so that you can write code that is clearer, more correct, more robust, and more reusable? Look no further! <i> <b> <i>Effective Java&trade;, Second Edition,</i> </b> </i> brings together&nbsp;seventy-eight indispensable programmer&rsquo;s rules of thumb: working, best-practice solutions for the programming challenges you encounter every day.</p>', '', 1);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(2, 'Design Patterns:  Elements of Reusable Object-Oriented Software', 'Addison-Wesley Professional', '1994-11-10', '<p>	Capturing a wealth of experience about the design of object-oriented software, four top-notch designers present a catalog of simple and succinct solutions to commonly occurring design problems. Previously undocumented, these 23 patterns allow designers to create more flexible, elegant, and ultimately reusable designs without having to rediscover the design solutions themselves.</p>', '', 1);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(3, 'Pro Spring 3', 'Apress', '2012-04-17', '<p>	The agile, lightweight, open-source Spring Framework continues to be the <em>de facto</em> leading enterprise Java application development framework for today&#39;s Java programmers and developers. It works with other leading open-source, agile and lightweight Java technologies like Hibernate, Groovy, MyBatis, and more. Spring now also works with Java EE and JPA 2 as well.</p>', '', 2);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(4, 'Murach''s Java Servlets and JSP', 'Mike Murach & Associates', '2014-06-09', '<p>	Now in its 3rd Edition, our classic book on Java web programming is still the top choice for mastering the many interrelated concepts and skills that you need to create web applications using servlets and JavaServer Pages (JSPs).</p>', '', 0);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(5, 'Modern JavaScript: Develop and Design',  'Peachpit Press', '2012-02-27', '<p>	It&rsquo;s time for a current, definitive JavaScript book, and in this comprehensive beginner&rsquo;s guide, bestselling author Larry Ullman teaches the language as it is implemented today. Larry demonstrates how to build upon JavaScript&rsquo;s ease of use, while demystifying its often-cryptic syntax, especially for those who have not programmed before.</p>', '', 0);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(6, 'UML Distilled',  'Addison-Wesley Professional', '2003-09-25', '<p>	Pressured with tight deadlines, application developers do not have the luxury of keeping completely up-to-date with all of the latest innovations in software engineering. Once in a great while, a tremendous resource comes along that helps these professionals become more efficient.</p>', '', 0);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(7, 'Beginning Java EE 7',  'Apress', '2013-06-26', '<p>	Java Enterprise Edition (Java EE) continues to be one of the leading Java technologies and platforms. <em>Beginning Java EE&nbsp;7</em> is the first tutorial book on Java EE&nbsp;7.&nbsp;</p>', '', 1);
INSERT INTO `book` (`ID`, `NAME`, `PUBLISHER`, `DATE_OF_PUBLICATION`, `DESCRIPTION`, `PHOTO`, `VERSION`) VALUES
(8, 'Pro JPA 2',  'Apress', '2013-09-24', '<p>	<strong><em>Pro JPA 2, Second Edition</em></strong> introduces, explains, and demonstrates how to use the new Java Persistence API (JPA) 2.1 from the perspective of one of the specification creators. A one-of-a-kind resource, it provides both theoretical and extremely practical coverage of JPA usage for both beginning and advanced developers.&nbsp;</p>', '', 1);